/*----------------------------------------------------------------------------
* Pad a string with null characters.
*---------------------------------------------------------------------------*/

void nullfill(char cptr[], int len)

{
  // Propagate the terminating null to the end of the string.
  int j;
  for (j = 0; j < len; j++) {
    if (cptr[j] == '\0') {
      for (int k = j+1; k < len; k++) {
        cptr[k] = '\0';
      }
      break;
    }
  }

  // Remove trailing blanks.
  for (int k = j-1; k >= 0; k--) {
    if (cptr[k] != ' ') break;
    cptr[k] = '\0';
  }

  return;
}

